import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import "./landing.css";
import 'aos/dist/aos.css';
import northeasternImage from "../assets/img/touristImage.avif";
import AOS from 'aos';
import { useEffect } from 'react';
import Filler from "../FillerComp/Filler";



const Landing = () => {

  useEffect(() => {
    AOS.init({
      // here you can configure AOS options
      duration: 1000, // animation duration in milliseconds
      once: false, // whether animation should happen only once - while scrolling down
    });
  }, []);


  return (
      <div className="Landing">
      <div className="background-section">
      <div className="text-container">
        <h1>Want to earn during flying?</h1>
        <h2>"Unlocking Extra Luggage Space: Share, Travel, and Earn!"</h2>
        <button className="sign-up-button">Sign Up</button>
      </div>
    </div>
    <Filler
        subtitle="What we do ?"
        title="We help flight travelers share their extra luggage space with fellow passengers, making travel more cost-effective and efficient."
        readMoreLink="#"
        readMoreText="Read More"
        imageSrc={northeasternImage} // Assuming northeasternImage is imported or provided elsewhere
        imageAlt="Northeastern University"
      />

    </div>
  );
};


export default Landing;
